import React from 'react';
import FileItem from './FileItem';
import uuid from 'uuid';

class Files extends React.Component {
    render() {
        return this.props.files.map((file) => (
            <FileItem file={file} key={uuid.v4()} />
        ));
    }
}

export default Files;
